import './App.css';
import Home from './pages/Home';
import React, { useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Progress from './pages/Progress';
import Leftbar from './component/Leftbar';
import Exeplore from './pages/Exeplore';
import Profile from './pages/Profile';
import PostForm from './component/PostForm';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { posts } from './postsData'; // Import posts from the common file

// ... rest of your code ...

<Route path="/Home" element={<Home posts={posts} />} />



function App() {
  const theme = createTheme({
    palette: {
      primary: {
        main: '#FFFFFF',
      },
      secondary: {
        main: '#FFFFFF',
      },
    },
  });

  const [postsState, setPostsState] = useState(posts);

  // Define the onPost function to add a new post
  const onPost = (newPost) => {
    setPostsState([newPost, ...postsState]);
  };

  return (
    <ThemeProvider theme={theme}>
      <BrowserRouter className="App">
        <div className="App">
          <Leftbar onPost={onPost} />
          <Routes>
          <Route path="/Home" element={<Home posts={posts} />} />
            <Route path="/prof" element={<Profile />} />
            <Route path="/prog" element={<Progress />} />
            <Route path="/exp" element={<Exeplore />} />
            <Route path="/Home/create" element={<PostForm />} />
          </Routes>
        </div>
      </BrowserRouter>
    </ThemeProvider>
  );
}

export default App;
